export function getProductCategories(): string[] {
  const lines = DADOS_CSV_CONTENT.split('\n');
  if (lines.length < 2) {
    return []; // No header or data
  }

  const header = lines[0].split(';');
  const familiaComercialIndex = header.indexOf('Familia_Comercial');

  if (familiaComercialIndex === -1) {
    console.warn("Column 'Familia_Comercial' not found in dados.csv header.");
    return [];
  }

  const categories: string[] = [];
  const seenCategories = new Set<string>();

  for (let i = 1; i < lines.length; i++) {
    const line = lines[i];
    if (!line) continue; // Skip empty lines

    const columns = line.split(';');
    if (columns.length > familiaComercialIndex) {
      const category = columns[familiaComercialIndex].trim();
      if (category && !seenCategories.has(category)) {
        categories.push(category);
        seenCategories.add(category);
      }
    }
  }
  return categories;
}

